import { Container, Row, Col, Card } from "react-bootstrap";
import "./Home.css";
import StatisticHome from "./StatisticHome";
import SubHome from "./SubHome";
import { useContext } from "react";
import { DataContext } from "../../Data/DataContext";
import Header from "../../Components/Header/Header";
import { Link } from "react-router-dom";
import $ from "jquery";
function Home() {
  const [nav, setNav, admin, setAdmin, user, setUser, clinic, setClinic] =
    useContext(DataContext);
  $("document").ready(function () {
    $(".test").animate({ marginTop: "10px" }, 1000);
  });
  return (
    <div>
      <Header />
      <div style={{ marginTop: "100px" }}>
        <Container className="Home">
          {/* Stack the columns on mobile by making one full-width and the other half-width */}
          <Row>
            <Col xs={12} md={4}>
              <a className="test" to="test">
                <SubHome
                  title="Users"
                  subtitle="Number of touch end users"
                  no={user.num}
                  src="./assets/icons/people-fill.svg"
                />
              </a>
            </Col>
            <Col xs={12} md={4}>
              <SubHome
                title="Clincs"
                subtitle="Number of registered clinics"
                no={clinic.num}
                src="./assets/icons/hospital-fill.svg"
              />
            </Col>
            <Col xs={12} md={4}>
              <SubHome
                title="Users&Clinics"
                subtitle="Total of users"
                no={user.num + clinic.num}
                src="./assets/icons/collection-fill.svg"
              />
            </Col>
          </Row>
        </Container>

        <Container className="Home">
          {/* Stack the columns on mobile by making one full-width and the other half-width */}
          <Row>
            <Col xs={12} md={4}>
              <SubHome
                title="Users"
                subtitle="Number of touch end users"
                no={user.num}
                src="./assets/icons/people-fill.svg"
              />
            </Col>
            <Col xs={12} md={4}>
              <SubHome
                title="Clincs"
                subtitle="Number of registered clinics"
                no={clinic.num}
                src="./assets/icons/hospital-fill.svg"
              />
            </Col>
            <Col xs={12} md={4}>
              <SubHome
                title="Users&Clinics"
                subtitle="Total of users"
                no={user.num + clinic.num}
                src="./assets/icons/collection-fill.svg"
              />
            </Col>
          </Row>
        </Container>
      </div>
    </div>
  );
}

export default Home;
